import { Link } from "react-router-dom";

const Line = (props) => {
  console.log(props);
  const dotList = props.conflicts
    .map((item) => {
      console.log(item.id);
      return (
        <li key={item.id}>
          <div>
            <time>{item.year}</time>
            <p>{item.name}</p>
            <p>{item.location}</p>
            <Link to={`/line/${item.id}`}>
              <button>Para saber m√°is</button>
            </Link>
          </div>
        </li>
      );
    })
    .sort((a, b) => b.year - a.year);
  return (
    <div className="line">
      <ul className="dotList">{dotList}</ul>
    </div>
  );
};

export default Line;
